import React, { Component } from 'react';
import logo from './logo.svg';
import axios from 'axios';
import './index.css';
import Home from './home';
import Sai from './sai';
import { HashRouter , Route, NavLink } from 'react-router-dom';
import { Card, CardImg, CardText, CardBody, CardTitle, CardSubtitle,
       Button,Row, Col,Container, Nav, NavItem } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.css';
class App extends Component {

  constructor(props){
    super(props);

    this.state = {
      stories:[]
    }

    axios.post('http://10.90.90.102:3002/').then(res=>{

      if(res.data.status == "success"){

        this.setState({stories:res.data.story});
       console.log(this.state.stories);

      }


    })

  }
  render() {

    var rowStyle={
      padding:"10px"
    }

    var hrStyle={
      backgroundColor:'black'
    }


    return (
      <HashRouter>
      <div>
      <Container style={rowStyle}>
        <Row>
          <Col sm="2"><h2><b>Medium</b></h2></Col>
          <Col sm="6"></Col>
          <Col sm="4">
            <Row>
              <Col sm='6'><a href="#" className="btn btn-outline-success">Become a member</a></Col>
              <Col sm='3'><a href="#" className="btn btn-outline-success">signup</a></Col>
              <Col sm='3'><a href="#" className="btn btn-outline-success" >Get started</a></Col>
            </Row>

          </Col>
        </Row> 
      </Container>
      <div style={rowStyle}>
      <Container>
        <Row>
            <Col sm="12">
              <Nav>

                <NavItem>
                  <NavLink to='/'>HOME</NavLink>
                </NavItem>

                <NavItem>
                  <NavLink to='/New arriaval'>THE NEW NEW</NavLink>
                </NavItem>

                <NavItem>
                  <NavLink to='/Culture'>CULTURE</NavLink>
                </NavItem>

                <NavItem>
                  <NavLink to='/tech'>TECH</NavLink>
                </NavItem>

                <NavItem>
                  <NavLink to='/politics'>POLITICS</NavLink>
                </NavItem>

                <NavItem>
                  <NavLink to='/design'>DESIGN</NavLink>
                </NavItem>

                <NavItem>
                  <NavLink to='/health'>HEALTH</NavLink>
                </NavItem>

                <NavItem>
                  <NavLink to='/collections'>COLLECTIONS</NavLink>
                </NavItem>

                <NavItem>
                  <NavLink to='/POPULAR'>POPULAR</NavLink>
                </NavItem>

              </Nav>
              </Col>
          </Row>
      </Container>
      </div>

      <div>
        <Route exact path='/' component={Home}></Route>
        <Route  path='/politics' component={sai}></Route>
        <Route  path='/tech' component={sai}></Route>
        <Route  path='/Culture' component={sai}></Route>
        <Route  path='/New arriaval' component={sai}></Route>
        <Route  path='/popular' component={sai}></Route>
        <Route  path='/collections' component={sai}></Route>
        <Route  path='/health' component={sai}></Route>
        <Route  path='/design' component={sai}></Route>
      </div>
      </div>
      </HashRouter>
    );
  }
}

export default App;
